    import formCreate from '@form-create/iview'
    import request from '@/plugins/request';
    import { mapState } from 'vuex';
    export default {
        name: 'edit',
        components: {
            formCreate: formCreate.$form()
        },
        computed: {
            ...mapState('admin/userLevel', [
                'taskId',
                'levelId'
            ])
        },
        props: {
            FromData: {
                type: Object,
                default: null
            },
			userEdit:{
			    type:Number,
				 default: 0
			},
        },
        data () {
            return {
                modals: false,
                type: 0,
                config: {
                    global: {
                        upload: {
                            props: {
                                onSuccess (res, file) {
                                    if (res.status === 200) {
                                        file.url = res.data.src;
                                    } else {
                                        this.Message.error(res.msg);
                                    }
                                }
                            }
                        }
                    }
                },
								isDisable:false
            }
        },
        methods: {
            couponsType () {
                this.$parent.addType(this.type);
            },
            // 提交表单 group
            onSubmit (formData) {
							  setTimeout(()=>{
							      this.isDisable=false
							  },1000)
							  if(this.isDisable) return
								this.isDisable=true
                let datas = {};
                datas = formData;
                request({
                    url: this.FromData.action,
                    method: this.FromData.method,
                    data: datas
                }).then(res => {
                    this.$parent.getList();
                    this.$Message.success(res.msg);
                    this.modals = false;
                    setTimeout(() => {
                        this.$emit('submitFail');
                    }, 1000);
                }).catch(res => {
                    this.$Message.error(res.msg);
                });
            },
            // 关闭按钮
            cancel () {
                this.type = 0;
                // this.$emit('onCancel')
            }
        }
    }
